import React, { Component, Fragment } from 'react';
import './Form.css';

const Form = function () {
    return <Fragment>
        <section id="form">
            <form action="https://formspree.io/gabriel_hg58@hotmail.com" method="POST">
                <input className="input" placeholder="Nome" type="text" required="true" />
                <input className="input" placeholder="Email" type="email" required="true" />
            </form>
        </section>
    </Fragment>;
}

export default Form;
